    {
      id: 1,
      label: "Frontend",
      name: "Project 3",
      description: "This is project 1",
      technologies: ["WordPress", "PHP", "MySQL"],
      githubUrl: "https://github.com/user/repo",
      demoUrl: "https://example.com",
      imageSrc: imag1,
